import React, { Component } from 'react'
import { Container, Row } from 'react-bootstrap'

export default class TeamStatistics extends Component {
    render() {
        return (
        <Container fluid="true">
            <Row>
                <h3>Team: {this.props.match.params.teamNumber}</h3>
            </Row>
        </Container>
        )
    }
}
